// ==UserScript==
// @name         Insert Test Case Links
// @namespace    http://datainterchange.com/
// @version      1.3
// @description  Adds links to Zephyr Test cases from PRs
// @author       River Adams
// @include      /^https?://dev\.azure\.com/epicor-corp/EDI.*/Di.Uno.Services.E2ETest.Dashboard/pullrequest/.*
// @include      /^https?://dev\.azure\.com/epicor-corp/EDI.*/Di.Uno.Services.IntegrationTest.DashboardApi/pullrequest/.*
// @include      /^https?://dev\.azure\.com/epicor-corp/EDI.*/Di.Uno.Services.AS2.Test/pullrequest/.*
// @include      /^https?://dev\.azure\.com/epicor-corp/EDI.*/Di.Uno.Services.OFTP.Test/pullrequest/.*
// @include      /^https?://epicor-corp\.visualstudio\.com/EDI.*/Di.Uno.Services.E2ETest.Dashboard/pullrequest/.*
// @include      /^https?://epicor-corp\.visualstudio\.com/EDI.*/Di.Uno.Services.IntegrationTest.DashboardApi/pullrequest/.*
// @include      /^https?://epicor-corp\.visualstudio\.com/EDI.*/Di.Uno.Services.AS2.Test/pullrequest/.*
// @include      /^https?://epicor-corp\.visualstudio\.com/EDI.*/Di.Uno.Services.OFTP.Test/pullrequest/.*
// @grant        none
// @run-at       document-body
// @require      https://cdnjs.cloudflare.com/ajax/libs/jquery/3.3.1/jquery.min.js#sha256-FgpCb/KJQlLNfOu91ta32o/NMZxltwRo8QtmkMRdAu8=
// @require      https://cdn.jsdelivr.net/npm/lodash@4.17.11/lodash.min.js#sha256-7/yoZS3548fXSRXqc/xYzjsmuW3sFKzuvOCHd06Pmps=
// @license      MIT
// @downloadURL https://update.greasyfork.org/scripts/477772/Insert%20Test%20Case%20Links.user.js
// @updateURL https://update.greasyfork.org/scripts/477772/Insert%20Test%20Case%20Links.meta.js
// ==/UserScript==

(function() {
    'use strict';
    var $ = window.jQuery;

    // Save CPU cycles - throttle requests to the onPageUpdated function
    const onPageUpdatedThrottled = _.throttle(onPageUpdated, 100, { leading: false, trailing: true });

    function onReady() {
        // Call our event handler if we notice new elements being inserted into the DOM. This happens as the page is loading or updating dynamically based on user activity.
        var target = $('body > div.full-size')[0];
        const observer = new MutationObserver(mutationList =>
                                             mutationList.filter(m => m.type === 'childList').forEach(m => {
            m.addedNodes.forEach(onPageUpdatedThrottled);
        }));
        observer.observe(target, {childList: true, subtree: true});
    }

    function onPageUpdated(){
        insertTestCaseLinks();
    }

    function insertTestCaseLinks(){

          // When viewing individual files
          $('div.view-line').each(function(index){
              var content = $(this).text();
              var url = getUrlFrom(content);
              if(url !== null){
                  // put an html link next to the item to link straight to zephyr scale
                  if($(this).find('span.viewtestcase').length === 0){
                      $(this).append(getLinkHtml(url));
                  }
              }
          });

        // When viewing differences only
        $('div.repos-diff-contents-row').each(function(index){
              var content = $(this).text();
              var url = getUrlFrom(content);
              if(url !== null){
                  // put an html link next to the item to link straight to zephyr scale
                  if($(this).find('span.viewtestcase').length === 0){
                      $(this).find('span.repos-line-content').append(getLinkHtml(url));
                  }
              }
          });
    }

    function getLinkHtml(url){
        return $(`<span class='viewtestcase'><a href='${url}'><img src='data:image/png;base64,' style='max-height: 12px;'></a></span>`);
    }

    function getUrlFrom(content){
        if(content.includes("AllureTms(\"DIP-T") || content.includes("AllureTestCase(\"DIP-T") || content.includes("AllureDataTestCase(\"DIP-T")){
            var id = content.match("DIP-T[0-9]+")[0];
            return `https://epicor.atlassian.net/projects/DIP?selectedItem=com.atlassian.plugins.atlassian-connect-plugin:com.kanoah.test-manager__main-project-page#!/testCase/${id}`
        }
        else{
            return null;
        }
    }
  // Start modifying the page once the DOM is ready.
  if (document.readyState !== 'loading') {
    onReady();
  } else {
    document.addEventListener('DOMContentLoaded', onReady);
  }
})();